import React from "react";

function SkillSlides(props){
    return (

        <>

        <svg xmlns={props.skillxmlns} viewBox={props.skillviewbox} className={props.skillimgclassname}>
        <path d={props.skillpath} />
        </svg>
        <p className={props.skillparagraphclassname}>{props.skillparagraphname}</p>

        </>
    )
}

export default SkillSlides;
